function App() {
  let todos=[
    {
      sno: 1,
      title:"Go to the market",
      desc: "You need to go to market to get the job done"
    },
    {
      sno: 2,
      title:"Go to the mall",
      desc: "You need to go to mall to get the j done"
    },
    {
      sno: 3,
      title:"Go to the market",
      desc: "You need to go to market to get the job done"
    }
  ]

  return (
    <>
    <Header title="My Todos List" searchBar={false}/>
    <Todos/>
    {/* <TodoItem/> */}
    <Footer/>
</>
  );
}

